import React from 'react';
import './App.css'; // ✅ Import your stylesheet

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Car Rescue Service</h1>
        <p>Reliable Roadside Assistance</p>
      </header>

      <main>
        <h2>Book a Rescue</h2>
        <p>Our service is just a click away!</p>
        {/* You can later include your booking form or map here */}
      </main>

      <footer className="App-footer">
        <p>&copy; {new Date().getFullYear()} Robert Motoring Consult</p>
      </footer>
    </div>
  );
}

export default App;
